// frontend/src/pages/MatchDetailPage.js
import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom"; // Хук для получения параметров из URL (например, ID матча)
import { getMatchById } from "../api"; // Импортируем функцию для получения деталей матча

function MatchDetailPage() {
  // Используем хук useParams для получения объекта с параметрами URL.
  // В нашем случае, мы ожидаем параметр 'matchId' (определен в App.js в роуте)
  const { matchId } = useParams();
  // Состояние для хранения данных о конкретном матче, начальное значение - null
  const [match, setMatch] = useState(null);
  // Состояние для отслеживания загрузки
  const [loading, setLoading] = useState(true);

  // useEffect для загрузки данных о матче при монтировании компонента или изменении matchId
  useEffect(() => {
    const fetchMatch = async () => {
      setLoading(true);
      // Вызываем функцию getMatchById из api.js, передавая ID матча из URL
      const data = await getMatchById(matchId);
      setMatch(data); // Обновляем состояние match
      setLoading(false);
    };

    fetchMatch();
  }, [matchId]); // Зависимость от matchId: эффект выполнится, если ID в URL изменится

  // Функция для форматирования даты и времени (аналогично MatchItem)
  const formatDateTime = (utcDateString) => {
    if (!utcDateString) return "N/A";
    try {
      const date = new Date(utcDateString);
      return date.toLocaleString("ru-RU", {
        day: "2-digit",
        month: "2-digit",
        year: "numeric",
        hour: "2-digit",
        minute: "2-digit",
      });
    } catch (e) {
      return utcDateString;
    }
  };

  // Если данные загружаются
  if (loading) {
    return <p>Загрузка деталей матча...</p>;
  }

  // Если матч не найден (например, неверный ID или ошибка API)
  if (!match) {
    return <p>Матч не найден.</p>;
  }

  // Если матч загружен, отображаем его детали
  return (
    <div>
      <h2>
        {match.homeTeam_crest && (
          <img src={match.homeTeam_crest} alt="" width="30" />
        )}
        {match.homeTeam_name} vs {match.awayTeam_name}
        {match.awayTeam_crest && (
          <img src={match.awayTeam_crest} alt="" width="30" />
        )}
      </h2>
      <p>
        <strong>Лига:</strong> {match.competition_name} (
        {match.competition_code})
      </p>
      <p>
        <strong>Дата и время:</strong> {formatDateTime(match.utcDate)} (МСК)
      </p>
      <p>
        <strong>Статус:</strong> {match.status}
      </p>
      <p>
        <strong>Тур:</strong> {match.matchday || "N/A"}
      </p>

      {match.status === "FINISHED" && (
        <div>
          <h3>Результат:</h3>
          <p>
            Счет: {match.score_fullTime_home} - {match.score_fullTime_away}
          </p>
          <p>Победитель: {match.score_winner || "Ничья"}</p>
        </div>
      )}

      {match.Predicted_Outcome && (
        <div>
          <h3>Прогноз:</h3>
          <p>Прогнозируемый исход: {match.Predicted_Outcome}</p>
          <p>
            Вероятность победы хозяев (Prob_H):{" "}
            {match.Prob_H?.toFixed(2) ?? "N/A"}
          </p>
          <p>Вероятность ничьи (Prob_D): {match.Prob_D?.toFixed(2) ?? "N/A"}</p>
          <p>
            Вероятность победы гостей (Prob_A):{" "}
            {match.Prob_A?.toFixed(2) ?? "N/A"}
          </p>
        </div>
      )}
      {/* Здесь можно добавить больше деталей, если они есть в вашем API */}
    </div>
  );
}

export default MatchDetailPage;
